import React, { useState } from "react";
interface InputProps {
  type?: string;
  placeholder?: string;
  label?: string;
  id: string;
}

const Input: React.FC<InputProps> = ({ type, placeholder, label, id }) => {
  return (
    <div className=" flex flex-row relative">
      <input
        id={type}
        className="px-3 w-3/4 border focus:outline-none border-black placeholder:text-gray-400"
        type={type}
      />
    </div>
  );
};

export default Input;
